import '../dash.css';
const Dashboard=()=>{
    return (
        <div className="container">
            <div className="row">
                <div className="col-12 col-md-12 col-xl-12 text-center">
                    <h1>Dashboard</h1>
                    <button className="btn btn-danger">Click</button>
                </div>
            </div>

        </div>
    )
}
export default Dashboard;
